(220, 9, 'banner_content', '<h1>One of Australia’s most experienced and accomplished creative agencies. Our team comprises exceptionally trained and highly skilled professionals. We have traded for over 30 years and developed thousands of projects.</h1>'),
(221, 9, '_banner_content', 'field_62dfb65d12332'),
(222, 9, 'banner_sub_content', 'With a proven track record and fine-tuned processes, we can produce complex projects, seamlessly. We are unreservedly trusted by the biggest companies in Australia. We have strong client relationships, some spanning 20 years. Our creativity and tailored solutions have been recognised by industry awards. '),
(223, 9, '_banner_sub_content', 'field_62dfb67212333'),
