(231, 9, '_services_heading', 'field_62dfb75e1233a'),
(232, 9, 'services_content', 'Project management, research & analysis, strategy development, concept development, graphic design, iconography design, business models design, packaging prototypes, copywriting & editing, intellectual property protection, text layout, proof reading, photography, filming, printing, share registry liaison, UI design, UX design, web & app development, online management, online hosting.'),
(233, 9, '_services_content', 'field_62dfb7681233b'),
(234, 9, 'directors_details_0_director_image', '144'),
(235, 9, '_directors_details_0_director_image', 'field_62dfb80a12343'),
(236, 9, 'directors_details_0_director_name', 'Livio De Marchi'),
(237, 9, '_directors_details_0_director_name', 'field_62dfb7b01233e'),
(238, 9, 'directors_details_0_director_designation', 'Founder & Chief Executive Officer'),
(239, 9, '_directors_details_0_director_designation', 'field_62dfb7b71233f'),
(240, 9, 'directors_details_0_director_details', 'Livio has built an impressive reputation as a creative strategist and business leader. Livio founded MDM Design in 1991 and is responsible for leading the development and growth of the company. He specialises in design and communication strategy and is the company’s joint Creative Director. Livio has lectured part-time, been a guest speaker for industry events and a judge for design and communication awards. Livio’s business acumen and creative drive gives him the ability to achieve outstanding results in all aspects of business.'),
(241, 9, '_directors_details_0_director_details', 'field_62dfb7c412340'),
