(247, 9, '_directors_details_1_director_image', 'field_62dfb80a12343'),
(248, 9, 'directors_details_1_director_name', 'John Manos'),
(249, 9, '_directors_details_1_director_name', 'field_62dfb7b01233e'),
(250, 9, 'directors_details_1_director_designation', 'Founder & Managing Director'),
(251, 9, '_directors_details_1_director_designation', 'field_62dfb7b71233f'),
(252, 9, 'directors_details_1_director_details', 'John is a highly respected corporate branding and investor communication expert. John founded MDM Design in 1991 and is responsible for overseeing the operations of the company. He specialises in brand and communication strategy and is the company’s joint Creative Director. John has been a regular contributor of articles to various publications and a guest speaker for industry events. John is a business savvy leader with a passion for all things aesthetic and strives to achieve excellence in everything he undertakes.'),
