(4, 6, '_home_page_banner_category_link', 'field_62e0d3a0f3594'),
(5, 5, 'framework_section_heading', 'PROJECT FRAMEWORK'),
(6, 5, '_framework_section_heading', 'field_62e7cd94985fc'),
(7, 5, 'framework_section_content', 'Our proprietary methodology is used to identify, understand and action all aspects of a project.'),
(8, 5, '_framework_section_content', 'field_62e7cdaa985fd'),
