(10, 5, '_framework_image', 'field_62e7cdb9985fe'),
(11, 5, 'products_section_heading', 'EXPERTISE'),
(12, 5, '_products_section_heading', 'field_62e7ce35f99b6'),
(13, 5, 'products_details_0_products_heading', 'Branding and digital'),
(14, 5, '_products_details_0_products_heading', 'field_62e7ce1bf99b4'),
(15, 5, 'products_details_0_products_content', 'We design and manage complex corporate brands for some of the world’s leading companies. We produce brand identities, marketing collateral, product packaging and campaigns. We also design and build digital and interactive communication including websites, smart phone and tablet apps and produce corporate videos and digital campaigns. We are experts in branding and producing digital projects.'),
(16, 5, '_products_details_0_products_content', 'field_62e7ce26f99b5'),
(17, 5, 'products_details_1_products_heading', 'Creating iconic brands'),
(18, 5, '_products_details_1_products_heading', 'field_62e7ce1bf99b4'),
(19, 5, 'products_details_1_products_content', 'MDM has a team of exceptionally experienced and skilled people that live and breathe branding. We know how to plan, design, and manage the rollout of a major brand including consultation with broad stakeholders. We design with a collective knowledge of the client and the greater business environment. We are well versed in intellectual property and trademarks, using both the Australian convention and the Madrid Protocol.'),
(20, 5, '_products_details_1_products_content', 'field_62e7ce26f99b5'),
(21, 5, 'products_details_2_products_heading', 'Bespoke websites'),
(22, 5, '_products_details_2_products_heading', 'field_62e7ce1bf99b4'),
(23, 5, 'products_details_2_products_content', 'We specialise in producing custom websites where the user interface (UI) design and the mapping of the user experience (UX) are integral to the finished result. We focus strategically on each company’s unique selling proposition, to make certain, we communicate perfectly with the end user. Our experience and knowledge of both branding and the online environment provides a unique advantage.'),
