(98, 6, '_products_details_0_products_heading', 'field_62e7ce1bf99b4'),
(99, 6, 'products_details_0_products_content', 'We design and produce best practice investor communication for some of Australia’s most established public companies. This includes annual reports, investor presentations, NOMs and online shareholder collateral. We have a meticulous understanding of ASX statutory reporting standards. We are in tune with reporting trends that ensures we exceed shareholder expectations and meet the demands of financial market analysts. '),
(100, 6, '_products_details_0_products_content', 'field_62e7ce26f99b5'),
(101, 6, 'products_details_1_products_heading', 'Sustainability reporting'),
(102, 6, '_products_details_1_products_heading', 'field_62e7ce1bf99b4'),
(103, 6, 'products_details_1_products_content', 'MDM has a team of expert designers for sustainability reporting. We design and produce ESG reports, SR, MSS, and D&I documents. MDM clearly understands and works with the United Nations, Sustainable Development Goals (SDG) framework and the Global Report Initiative (GRI) standards, which many listed companies have adopted to communicate their sustainability pathway.\r\n'),
(104, 6, '_products_details_1_products_content', 'field_62e7ce26f99b5'),
(105, 6, 'products_details_2_products_heading', 'Prospectuses'),
(106, 6, '_products_details_2_products_heading', 'field_62e7ce1bf99b4'),
(107, 6, 'products_details_2_products_content', 'We design and produce prospectuses and transactional documents including IPOs, capital raisings and M&As. We can assist private companies to successfully list and secure a place on the ASX or we can professionally communicate the benefits of a takeover bid to investors. Knowing how to communicate persuasively with all stakeholders, including investors and shareholders is paramount to a successful outcome.'),
(108, 6, '_products_details_2_products_content', 'field_62e7ce26f99b5'),
